    "2015-07-16T21:37:22.629397",nt"name": "core-based-statistical-areas-national",nt"isopen":
    false,nt"url": null,nt"notes": "The TIGER/Line Files are shapefiles and
    related database files (.dbf) (NTAD 2015) that are an extract of selected geographic
    and cartographic information from the U.S. Census Bureau's Master Address File /
    Topologically Integrated Geographic Encoding and Referencing (MAF/TIGER) Database
    (MTDB). The MTDB represents a seamless national file with no overlaps or gaps between
    parts, however, each TIGER/Line File is designed to stand alone as an independent
    data set, or they can be combined to cover the entire nation. Metropolitan and Micropolitan
    Statistical Areas are together termed Core Based Statistical Areas (CBSAs) and are
    defined by the Office of Management and Budget (OMB) and consist of the county or
    counties or equivalent entities associated with at least one urban core (urbanized
    area or urban cluster) of at least 10,000 population, plus adjacent counties having
    a high degree of social and economic integration with the core as measured through
    commuting ties with the counties containing the core. Categories of CBSAs are: Metropolitan
    Statistical Areas, based on urbanized areas of 50,000 or more population, and Micropolitan
    Statistical Areas, based on urban clusters of at least 10,000 population but less
    than 50,000 population. The CBSAs for the 2010 Census are those defined by OMB and
    published in December 2009.",nt"license_title": null,nt"extras": [{ntt"key":
